INSERT INTO punchline VALUES (null,"Tu ne passeras pas, adversaire-kun !","Je ne suis pas ton rival","Pourtant je vais le faire","Tant que je ne m'approche pas de toi, ça me va","C'est pas sympa",1);
INSERT INTO punchline VALUES (null,"Tu ne le sais pas, mais tu as déjà perdu !","Je suis l'homme aux sept vitesses","Même pas vrai !","C'est celui qui dit qui est","Je ne pense pas",1);
INSERT INTO punchline VALUES (null,"Je suis level 100 !","En tuant des sangliers ?","Tu n'es toujours pas assez fort","Tu sais compter jusque là ?","Ha oui ?",1);
INSERT INTO punchline VALUES (null,"Tu compte me dépasser newbie ?","J'ai suivi un entrainement rigoureux dans la salle du temps","C'est pas sympa","Je suis plus fort que toi","Oui",1);
INSERT INTO punchline VALUES (null,"Ma souffrance n'a d'égal que ma vitesse","Tu t'es cassé un ongle ?","La douleur te ralentit","Ce n'est pas difficile de conduire avec des cheveux dans les yeux","C'est cool",2);
INSERT INTO punchline VALUES (null,"Si tu n'as jamais connu l'amour, tu n'a pas connu la peine","**Rien à faire**","Peine de coeur ? Pat Pat","La demoiselle a connu une rupture amoureuse. Ouin Ouin","C'est triste",2);
INSERT INTO punchline VALUES (null,"Le prochain virage me fait penser à ma vie","Parce qu'il est sans intérêt ?","Parce qu'il a des traces de frein ?","Parce qu'il est tordu ?","Moi aussi",2);
INSERT INTO punchline VALUES (null,"Je conduis sans ABS","Pour te muscler le pied ?","Fallait pas conduire une antiquité","Tu n'arrivais pas l'épeler ?","Moi non plus",3);
INSERT INTO punchline VALUES (null,"J'ai fais 200 pompes ce matin, je suis dans les starting bloc","J'ai mal à mon français","C'était un petard mouillé ?","T'as raté ton démarrage !?","Ah bon ?",3);
INSERT INTO punchline VALUES (null,"Mate mes muscles saillant !","Je mangerai bien un tacos moi","T'en a pas besoin pour conduire","Non merci !","J'ai autre chose à faire... comme conduire.",3);
INSERT INTO punchline VALUES (null,"Mes calculs m'indiquent que tu ne me dépasseras pas","Tu devrais consulter un médecin pour tes calculs","Comment tu peux tenir le volant en comptant sur tes doigts ?","J'ai fais un bac L","Tu devais revoir tes calculs",4);
INSERT INTO punchline VALUES (null,"Mon intelligence est sans limite","Parcequ'on ne peux pas diviser par zéro","Comme ta bêtise","Dommage que ça ne soit pas le cas de ta vitesse","Et moi je suis encore plus malin",4);
INSERT INTO punchline VALUES (null,"Comment as-tu eu le permis avec ton Q.I ?","T'as eu besoin de réfléchir pour avoir ton permis ?","Ils le donnent à n'importe qui, la preuve.","J'ai payé un nerd pour le passer à ma place","J'ai pas le permis",4);
INSERT INTO punchline VALUES (null,"La seule chose que je veux voir de toi, c'est ton reflet lointain dans mon rétro-viseur","Pas sûr que tu me vois aussi loin devant, même avec tes lunettes","La seule chose que tu vas voir de moi, c'est la fumée de mon pot d'échappement","Je ne vois pas ce que tu veux dire","Encore faudrait-il que tu arrêtes de te reluquer",4);
INSERT INTO punchline VALUES (null,"Tu as été vilain, pas de cadeaux pour toi !","Ça serait dommage de me donner du charbon et de priver ta voiture de son combustible","Mais j'ai été gentil !","Je n'ai pas besoin de ta générosité pour gagner","C'est pas sympa",5);
INSERT INTO punchline VALUES (null,"Il est prouvé que le rouge de ma tunique me fait aller plus vite","Il est prouvé que le rouge que tu as bu te fait voir plus flou","Je suis daltonien","Je n'avais pas vu que ta voiture était rouge tellement elle est sale","Ha, je ne savais pas !",5);
INSERT INTO punchline VALUES (null,"Ma voiture tourne à au moins 900 reines","Faudra penser à les nourrir un peu vu comme ils se trainent","Comment tu fais rentrer tout ça ?","Lequel s'appelle Rudolph ?","On t'appelle la reine des neiges ?",5);
INSERT INTO punchline VALUES (null,"Eloigne-toi si tu ne veux pas finir comme mon troisième mari","Au bahamas avec une femme plus jeune que toi ?","En prison pour détournement de mineur ?","Dans le salon en train de regarder le foot à la télé ?","Tu as eu trois maris ?",6);
INSERT INTO punchline VALUES (null,"Tu n'auras pas le temps de voir la lame qui mettra fin à tes jours","Tu ne pourras pas poignarder une ombre","Je ne suis pas fan de Laam","Attention avec ça, tu vas te blesser","Tu as un permis pour ça ?",6);
INSERT INTO punchline VALUES (null,"Tu ne peux rien face à une femme fatale telle que moi","En effet, je ne pas perdre","Erreur fatale","Femme fatale, toi ?","Je vais te prouver le contraire",6);
INSERT INTO punchline VALUES (null,"J'm suis dopé aux bonbons mon mignon.","","Rentre chez toi jouer à la dinnette, midinette.","T'es pas à la sieste ?","T'as un button off ?",7);
INSERT INTO punchline VALUES (null,"Je suis Lady Joana! Laisse moi passer roturier!","jE sUIs lAdY jOanA! lAiSse Moi pASseR rOTurIeR!","Roturier moi ? Je suis mon propre roi! Je suis ma propre route !","Lady castoad'là plutôt","Humilité tu connais ?",7);
INSERT INTO punchline VALUES (null,"Mon père possède ce circuit !","Il aurait dû te payer des leçons de conduite","Il aurait dû payer pour avoir une meilleure pilote","Il aurait dû me payer pour devoir t'écouter","Il a payé combien ?",7);